import fond from './images/fond.png';
import './musique.css';
import bgVideo from './images/video_fond.mp4';

function Musique() {


  return (
    
    <div className='container_global'>
            <video src={bgVideo}></video>
      <div className="div_musique">
          <div className='container'>
            <span className='fond_ico'></span>
            <span className='fond_ico'></span>
            <span className='fond_ico'></span>
          </div>
      </div>

    </div>
    
  );
}

export default Musique;
